window.bookSummaryJSON = "<p>The time: six months prior to the launch of the <i>U.S.S. Enterprise</i> 1701-B and the tragic loss of Captain James T. Kirk in deep space. The place: Earth, where the galaxy's most renowned hero must face the spectre of retirement. But Kirk's path takes an unexpected turn when a mysterious woman offers him an irresistible adventure - a voyage to an uncharted planet where he will confront the ultimate threat to the peace between the Federation and the Klingon Empire, and the ultimate temptation - a chance to recapture his youth. </p>"; 
